import {jsPDF} from "jspdf"

const fontNormal = '';
const fontItalic = '';
const callAddFont = function () {
    this.addFileToVFS('ElementalEnd-normal.ttf', fontNormal);
    this.addFileToVFS('ElementalEnd-normal.ttf', fontItalic);
    this.addFont('ElementalEnd-normal.ttf', 'Elemental End', 'normal');
    this.addFont('ElementalEnd-normal.ttf', 'Elemental End', 'italic');
};
jsPDF.API.events.push(['addFonts', callAddFont])
